import './App.css';
import Carts from './Carts';
import NavBar from './components/NavBar';
import Preloader from './components/PreLoader';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <Preloader/>
      <Carts/>
    </div>
  );
}

export default App;
